import React from 'react';
import { useTranslation } from 'react-i18next';
import { useNavigate } from 'react-router-dom';
import { Bot, ArrowLeft, Brain, MessageSquare, BarChart, Eye } from 'lucide-react';
import './AIServices.css';

const AIServicesPage = () => {
  const { t } = useTranslation();
  const navigate = useNavigate();

  const aiServices = [
    {
      icon: <Brain size={24} />,
      title: 'Machine Learning Solutions',
      description: 'Custom ML models and algorithms to solve complex business problems',
      technologies: ['TensorFlow', 'PyTorch', 'Scikit-learn', 'Keras']
    },
    {
      icon: <MessageSquare size={24} />,
      title: 'AI Chatbots & NLP',
      description: 'Intelligent conversational AI and natural language processing solutions',
      technologies: ['GPT APIs', 'BERT', 'spaCy', 'Dialogflow']
    },
    {
      icon: <Eye size={24} />,
      title: 'Computer Vision',
      description: 'Image recognition, object detection, and visual analysis systems',
      technologies: ['OpenCV', 'YOLO', 'ResNet', 'TensorFlow Vision']
    },
    {
      icon: <BarChart size={24} />,
      title: 'Data Analytics & AI',
      description: 'Predictive analytics and business intelligence powered by AI',
      technologies: ['Pandas', 'NumPy', 'Tableau', 'Power BI']
    }
  ];

  return (
    <div className="ai-page">
      <div className="ai-header">
        <button className="ai-back-button" onClick={() => navigate(-1)}>
          <ArrowLeft size={18} />
          <span>Back</span>
        </button>

        <div className="ai-header-content">
          <div className="ai-icon">
            <Bot size={36} />
          </div>
          <h1>AI & Machine Learning Services</h1>
          <p>Harness the power of artificial intelligence to automate processes and gain valuable insights</p>
        </div>
      </div>

      <div className="ai-content">
        <div className="ai-grid">
          {aiServices.map((service, index) => (
            <div key={index} className="ai-card">
              <div className="ai-icon-small">
                {service.icon}
              </div>
              <h3>{service.title}</h3>
              <p>{service.description}</p>
              <div className="ai-tech">
                {service.technologies.map((tech, techIndex) => (
                  <span key={techIndex} className="ai-tech-tag">{tech}</span>
                ))}
              </div>
            </div>
          ))}
        </div>

        <div className="ai-cta">
          <h2>Ready to Implement AI Solutions?</h2>
          <p>Transform your business with cutting-edge AI technology and machine learning</p>
          <button className="ai-cta-btn">Explore AI Solutions</button>
        </div>
      </div>
    </div>
  );
};

export default AIServicesPage;
